  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1956. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, vegetation control, and wildfires. Resource management
  is outlined; topics include grazing, haying, and fur harvesting. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  and hunting. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
